import React from 'react';
import { StyledWrapper, ChekoutHeader, HeaderBlock,TotalPrice } from './styles';
import { connect } from 'react-redux';
import { createStructuredSelector } from 'reselect';
import { selectCartItems,selectCartTotalPrice } from '../../redux/cart/cart.selectors';

const CheckoutPage = ({ cartItems,itemsPrice }) => {
    console.log('cartItems', cartItems);
    console.log('sum of price', itemsPrice);
	return (
		<StyledWrapper>
			<ChekoutHeader>
				<HeaderBlock>
					<span>Produkt</span>
				</HeaderBlock>
				<HeaderBlock>
					<span>Opis</span>
				</HeaderBlock>
				<HeaderBlock>
					<span>Ilość</span>
				</HeaderBlock>
				<HeaderBlock>
					<span>Cena</span>
				</HeaderBlock>
				<HeaderBlock>
					<span>Usuń</span>
				</HeaderBlock>
			</ChekoutHeader>
            {
                cartItems.map(item => 
                    item.name
                    )
            }
            <TotalPrice>{itemsPrice}</TotalPrice>
		</StyledWrapper>
	);
};

const mapStateToProps = createStructuredSelector({
    cartItems: selectCartItems,
    itemsPrice:selectCartTotalPrice
});

export default connect(mapStateToProps)(CheckoutPage);
